import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import { Auth0Provider } from '@auth0/auth0-react';
import { BrowserRouter } from 'react-router-dom';
import { useNavigate } from 'react-router-dom';

const Auth0ProviderWithRedirectCallback = ({ children }) => {
  const navigate = useNavigate();

  const onRedirectCallback = (appState) => {
    navigate(appState?.returnTo || '/dashboard'); // default to dashboard
  };

  return (
    <Auth0Provider
      domain="dev-rb7h2zv1l2rb2ysz.us.auth0.com"
      clientId="03mm5T3PAz4NEprAmQTPYXGTeNx891Io"
      authorizationParams={{
        redirect_uri: window.location.origin,
      }}
      onRedirectCallback={onRedirectCallback}
    >
      {children}
    </Auth0Provider>
  );
};

// Wrap Auth0Provider with BrowserRouter
const Root = () => (
  <BrowserRouter>
    <Auth0ProviderWithRedirectCallback>
      <App />
    </Auth0ProviderWithRedirectCallback>
  </BrowserRouter>
);

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<Root />);
